import ProfileCard from "./ProfileCard";
import style from './mystyle.module.css';
import {Container, Row, Col} from 'react-bootstrap';

function App(){
  return (
      <div >
        <Container>
          Perofessional Experiences
          <Row>
            <Col>
              <ProfileCard professionalExperience="Web Developer"/>
            </Col>
            <Col>
              <ProfileCard professionalExperience="Data Analysis"/>
            </Col>
            <Col>
              <ProfileCard professionalExperience="Librarian"/>
            </Col>
          </Row>
          <Row>
            <Col>2</Col>
          </Row>


        </Container>
      </div>
  );
}

export default App;
